			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "if [ $CONFIGURATION = \"Release\" ]\nthen\n\tcd MacOSaiX\n\tgenstrings -o English.lproj *.m */*.m\n\n\tcd \"$SRCROOT\"\n\tfind . -name \"*.nib\" -o -name \"*.strings\" | grep -v CVS | grep -v \"~\" > Localizable.files\n\ttar cfz Localizable.tgz --files-from Localizable.files\n\t#rm Localizable.files\n\t\n\t# Mock up the contents of the disk image in a new folder.\n\tcd \"$TARGET_BUILD_DIR\"\n\trm -rf MacOSaiX\n\tmkdir -p MacOSaiX\n\tcp -r MacOSaiX.app MacOSaiX\n\t# TODO: add a background image, alias to Applications, etc.\n\t\n\t# Eject any previous disk image and wait for it to unmount completely.\n\twhile test -d /Volumes/MacOSaiX ; do sleep 1; done;\n\tosascript\t -e 'tell application \"Finder\" to if exists disk \"MacOSaiX\" then eject disk \"MacOSaiX\"'\n\t\n\t# Create a modifiable disk image based on the mocked up folder.\n\trm -f MacOSaiX_working.dmg\n\thdiutil create -srcfolder MacOSaiX -format UDRW -attach MacOSaiX_working.dmg\n\t\n\t# Make sure the disk image's window opens in icon view even if the default is column view.\n\tbless --folder \"/Volumes/MacOSaiX\" --openfolder \"/Volumes/MacOSaiX\"\n\t\n\t# Set the visual properties of the folder's window.\n\tosascript\t\t-e\t'tell application \"Finder\"' \\\n\t\t\t\t-e\t\t'tell container window of disk \"MacOSaiX\"' \\\n\t\t\t\t-e\t\t\t'open' \\\n\t\t\t\t-e\t\t\t'set current view to icon view' \\\n\t\t\t\t-e\t\t\t'tell its icon view options' \\\n\t\t\t\t-e\t\t\t\t'set icon size to 128' \\\n\t\t\t\t-e\t\t\t\t'set text size to 16' \\\n\t\t\t\t-e\t\t\t\t'set arrangement to not arranged' \\\n\t\t\t\t-e\t\t\t\t'set background color to {65535, 64352, 52722}' \\\n\t\t\t\t-e\t\t\t'end tell' \\\n\t\t\t\t-e\t\t\t'set toolbar visible to false' \\\n\t\t\t\t-e\t\t\t'set bounds to {100, 100, 348, 296}' \\\n\t\t\t\t-e\t\t\t'set position of item 1 of target to {121, 79}' \\\n\t\t\t\t-e\t\t\t'set toolbar visible to true' \\\n\t\t\t\t-e\t\t\t'set toolbar visible to false' \\\n\t\t\t\t-e\t\t'end tell' \\\n\t\t\t\t-e\t'end tell'\n\t\n\t# Wait for the Finder to update the .DS_Store file.\n\tsleep 6\n\t\n\t# Eject the disk image and wait for it to unmount completely.\n\tosascript\t-e 'tell application \"Finder\" to eject disk \"MacOSaiX\"'\n\twhile test -d /Volumes/MacOSaiX ; do sleep 1; done;\n\t\n\t#exit 0\n\t\n\t# Create the final compressed, read-only version of the disk image.\n\trm -f MacOSaiX.dmg\n\thdiutil convert MacOSaiX_working.dmg -format UDZO -o MacOSaiX.dmg\n\t#hdiutil makehybrid -o MacOSaiX.dmg MacOSaiX_working.dmg -hfs -hfs-openfolder /Volumes/MacOSaiX\t\n\t# Let's have a look...\n\topen MacOSaiX.dmg\nfi";
